import './NextVideo.scss';

function NextVideo({ image, title, channel }) {
  return (
    <section>
      <article>
        <figure>
          <img width="30%" src={image} alt="Video Thumbnail" />
        </figure>
        <div>
          <h3>{title}</h3>
          <p>{channel}</p>
        </div>
      </article>
    </section>
  );
}

export default NextVideo;
